// src/data/DummyData.js
const interests = [
    "Animals", "Arts and Culture", "Books", "Computers or Technology",
    "Cooking and Baking", "Creativity", "Fashion", "Gaming", "Gardening"
];

const experiences = [
    "Abuse", "Addiction", "Anger", "Anxiety", "Bipolar disorder",
    "Depression", "Dissociative Disorders", "Eating problems", "Health Anxiety",
    "Loneliness", "Trauma"
];

const peerGroups = [
    {
        id: 1,
        name: "Cinema Lovers",
        description: "A group for people who love discussing and watching movies.",
        category: "Movies",
        image: "/images/cinema-clipart.png"
    },
    {
        id: 2,
        name: "Trauma Support Network",
        description: "Connect with others who are working through past trauma.",
        category: "Trauma",
        image: "/images/trauma-support-clipart.png"
    }
];

export { interests, experiences, peerGroups };
